import "./register.css";
import React, { useState } from "react";

export default function RegisterComponent() {
  //setting variables using useState
  // useState[var, func to update var ] = useState(initialValue)
  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [dob, setDob] = useState(new Date());
  const [email, setEmail] = useState("");
  const [address, setAddress] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  // handeling user registration
  const registerUser = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(false);

    try {
      if (password !== confirmPassword) {
        setError("Passwords donot match!");
        setLoading(false);
      } else {
        const response = await fetch("http://localhost:7000/api/newUser", {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify({
            firstName,
            lastName,
            email,
            DOB: dob,
            address,
            password,
          }),
        });

        if (!response.ok) {
          throw new Error("Network response was not ok");
        }

        const data = response.json();
        console.log("Sucess : ", data);
      }
    } catch (error) {
      setError(error.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="register-">
    <form className="register-container" onSubmit={registerUser}>
      <label className="register">REGISTER</label>
      <label htmlFor="firstName">First Name </label>
      <input
        type="text"
        id="firstName"
        className="register-input"
        placeholder="John"
        value={firstName}
        onChange={(e) => setFirstName(e.target.value)}
      />
      <br />
      <label htmlFor="lastName">Last Name </label>
      <input
        type="text"
        id="lastName"
        className="register-input"
        placeholder="Doe"
        value={lastName}
        onChange={(e) => setLastName(e.target.value)}
      />
      <br />
      <label htmlFor="dob">Date of Birth </label>
      <input
        type="date"
        id="dob"
        className="register-input"
        placeholder="1990-08-30"
        value={dob}
        onChange={(e) => setDob(new Date(e.target.value))}
      />
      <br />
      <label htmlFor="email">Email </label>
      <input
        type="text"
        id="email"
        className="register-input"
        placeholder="john.doe@example.com"
        value={email}
        onChange={(e) => setEmail(e.target.value)}
      />
      <br />
      <label htmlFor="address">Address </label>
      <input
        type="text"
        id="address"
        className="register-input"
        placeholder="789 Birch S"
        value={address}
        onChange={(e) => setAddress(e.target.value)}
      />
      <br />
      <label htmlFor="password">Password </label>
      <input
        type="password"
        id="password"
        className="register-input"
        placeholder="****"
        value={password}
        onChange={(e) => setPassword(e.target.value)}
      />
      <br />
      <label htmlFor="confirmPassword">Confirm Password </label>
      <input
        type="password"
        id="confirmPassword"
        className="register-input"
        placeholder="****"
        value={confirmPassword}
        onChange={(e) => setConfirmPassword(e.target.value)}
      />
      <br />
      {error && <p>Error: {error}</p>}
      <button type="submit" disabled={loading} className="submit-button">
        {loading ? "Submitting..." : "Submit"}
      </button>
    </form>
    </div>
  );
}
